import React from "react";
import { List, ListItem, Input, withStyles } from "@material-ui/core";

const styles = theme => ({
  input: {
    margin: theme.spacing.unit
  }
});

export default withStyles(styles)(({ classes }) => {
  return (
    <List component="ul">
      <ListItem>
        <Input
          defaultValue="Hello world"
          className={classes.input}
          inputProps={{
            "aria-label": "Search"
          }}
        />
      </ListItem>
    </List>
  );
});
